import './Nav.css';
import { Link } from 'react-router-dom';

function Nav() {
    return (
        <div className='Nav'>
            <span className='nav-link'><Link to='/'>Aashna Verma</Link></span>
            <span className='nav-link'><Link to='/art'>./art</Link></span>
            <span className='nav-link'><Link to='/projects'>./projects</Link></span>
            <span className='nav-link'><Link to='/contact'>./contact</Link></span>
            <span className='nav-link'><Link to='/inspiration'>./inspiration</Link></span>
        </div>
    );
}

export default Nav;
